import './Prompt.css';

const Prompt = ({prompt}) => {
    const formattedPrompt = (
            <h4>{prompt.title}</h4>
        )
    

    return (
        <div className='promptContainer'>
            {formattedPrompt}
        </div>
    )
}

export default Prompt;
